import math

def arc_length(x, y):
    return math.sqrt(1 + (y/x)**2)

def main():
    t = 5
    while t <= 12:
        x = 2*t
        y = 2/3*t**(3/2)
        print(arc_length(x, y))
        t += 0.01

main()

